import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { PaiPageComponent } from './pages/pai-page.component';
import { ModuloPaiRoutingModule } from './pages/pai-routing.module';
import { PaiFilhosComponentsModule } from './pages/filhos-components.modulo';


@NgModule({
  declarations: [
    AppComponent,
    PaiPageComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    ModuloPaiRoutingModule,
    FilhosComponentsModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
